import React from 'react';
import './App.css';

const App = () => {

  return (
    <>
    <header className="header">
      <h1> Test 1 </h1>
    </header>
    <div className="buttonContainer">
      <button className="button">A -> Z</button>
      <button className="button">Catagorized</button>
    </div>
    </>
  );
}

export default App;
